Este projeto é uma aplicação web de uma calculadora simples desenvolvida utilizando HTML, CSS, e JavaScript. A interface da calculadora permite realizar operações básicas como adição, subtração, multiplicação e divisão, além de funcionalidades para limpar a entrada atual ou apagar um caractere por vez.

<span class="hljs-section">## Demonstração</span>

Você pode visualizar o projeto em funcionamento acessando: [<span class="hljs-string">Calculadora Simples</span>](<span class="hljs-link">https://github.com/Paulosxb/Calculadora/</span>)

<span class="hljs-section">## Funcionalidades</span>

<span class="hljs-bullet">-</span> <span class="hljs-strong">**Operações Básicas:**</span> Realiza adição, subtração, multiplicação e divisão.
<span class="hljs-bullet">-</span> <span class="hljs-strong">**Limpeza de Tela:**</span> Possui um botão para limpar toda a entrada (<span class="hljs-code">`C`</span>) e outro para apagar um caractere por vez (<span class="hljs-code">`&lt;`</span>).
<span class="hljs-bullet">-</span> <span class="hljs-strong">**Entrada de Números:**</span> Permite a entrada de números clicando nos botões correspondentes na interface.
<span class="hljs-bullet">-</span> <span class="hljs-strong">**Resultado:**</span> Apresenta o resultado da operação ao clicar no botão de igual (<span class="hljs-code">`=`</span>).

<span class="hljs-section">## Tecnologias Utilizadas</span>

<span class="hljs-bullet">-</span> HTML: Estrutura da página.
<span class="hljs-bullet">-</span> CSS: Estilização da página, incluindo gradientes de fundo e estilos dos botões.
<span class="hljs-bullet">-</span> JavaScript: Lógica para realizar as operações da calculadora.

